  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is available as a downloadable
  file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map,
  Cross Section image, Tectonic map, Stratigraphic column image, Glacial map, Schematic
  map, and a text for the Bedrock geology of the Equinox Quadrangle and Vicinity,
  Vermont. For more information see links provided. Abstract: The Equinox quadrangle
  and a small strip from its western boundary  to the New York State line were mapped
  geologically. Three main  sections were studied. From east to west they are the
  Green Mountains, Vermont Valley, and Taconic Range plus a small portion of the western
  \ low hills section. Formations studied range in age from pre Cambrian to middle
  or upper Ordovician.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
